import React from 'react';
const SkillForm = ({addSkills}) =>(
<div>
<h1 className="skill_heading">Add Skills</h1>
  <form
   className="form" onSubmit={props.handleSubmit} >

   <input required type="text" value={props.title}
   placeholder="Add Skills"/> <br /><br />
   <textarea required rows="4" value={props.message} cols="28"
   placeholder="Skills detail" /><br /><br />
   <button>Add</button>
  </form>
  </div>

);

export default SkillForm;
